import { useState } from "react";

export const Main = () => {
  const [currPage, setCurrPage] = useState<string>("Home");
  const moveToRegister = () => {};

  return (
    <div>
      {currPage === "Home" && (
        <div className="container">
          <form
            onSubmit={(e) => {
              e.preventDefault();
            }}
          >
            <h2 className="mb-3">Login</h2>
            <div className="input">
              <label htmlFor="email">Email address</label>
              <input
                className="form-control"
                type="text"
                name="email"
                placeholder="email@address.com"
                v-model="email"
              />
            </div>
            <div className="input">
              <label htmlFor="password">Password</label>
              <input
                className="form-control"
                type="password"
                name="password"
                placeholder="password123"
                v-model="password"
              />
            </div>
            <div className="alternative-option mt-4">
              You don't have an account?{" "}
              <span onClick={moveToRegister}>Register</span>
            </div>
            <button type="submit" className="mt-4 btn-pers" id="login_button">
              Login
            </button>
            <div
              className="alert alert-warning alert-dismissible fade show mt-5 d-none"
              role="alert"
              id="alert_1"
            ></div>
          </form>
        </div>
      )}
      {}
    </div>
  );
};
